import React from "react";
import Main from "./Main";
import App from './App';
import Contact from './Contact';
import Home from './Home';
import Projects from './Projects';
import {BrowserRouter as Router,Switch,Route,Link} from "react-router-dom";
import './index.css';
import Jumbotron from './Jumbotron';

function Navbar(){

    return(
        <div>

            <nav class="navbar navbar-default navbar-expand-lg bg-white fixed-top">

            <a class="navbar-brand text-dark" href="#">Ethan Wang-So</a>
            <button class="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
                <span class="navbar-toggler-icon"></span>
            </button>

            <div class="collapse navbar-collapse" id="navbarSupportedContent">
                <ul class="navbar-nav">
                    <li class="nav-item">
                        <Link class="text-dark" to="/">Home</Link>
                    </li>
                    <li class="nav-item">
                        <Link class="text-dark" to="/contact">Contact</Link>
                    </li>
                    <li class="nav-item">
                        <Link class="text-dark" to="/projects">Projects</Link>
                    </li>
                </ul>
            </div>

            </nav>
            <Jumbotron />
            <Switch>
                <Route path="/" exact component={Main} />
                <Route path="/contact" exact component={Contact} />
                <Route path="/projects" exact component={Projects} />
                <Route path="/projects/:key" exact component={Projects} />
            </Switch>


        </div>


    );
}


export default Navbar;
